import React from "react";
import CarouselComponentNow from "./(utils)/CarouselNow";
import CarouselComponentWeek from "./(utils)/CarouselWeek";

const Trending = () => {
  return (
    <div className="flex flex-col gap-5 pl-10 pt-10">
      <div className="text-xl font-bold flex flex-row gap-10 items-center">
        <div className="p-1">Trending</div>
        <div className="flex gap-3 border-2 rounded-3xl">
          <span className="bg-gray-400 rounded-3xl p-1 cursor-pointer">
            Today
          </span>
          <span className="p-1" onClick={<CarouselComponentWeek />}>
            All Week
          </span>
        </div>
      </div>
      <div>
        <CarouselComponentNow />
      </div>
    </div>
  );
};

export default Trending;
